private static int encodeQuotedPrintable(final int b, final ByteArrayOutputStream buffer) {
    buffer.write(ESCAPE_CHAR);
    final char hex1 = Utils.hexDigit(b >> 4);
    final char hex2 = Utils.hexDigit(b);
    buffer.write(hex1);
    buffer.write(hex2);
    return 3;
}

