        final byte[] schedule = MSG_SCHEDULE[i];
        round(state, blockWords, schedule);
    }
    for (int i = 0; i < state.length / 2; i++) {
        state[i] ^= state[i + 8];
        state[i + 8] ^= chainingValue[i];
    }
    return state;
}

