private static int[] unpackInts(final byte[] buf, final int nrInts) {
    final int[] values = new int[nrInts];
    for (int i = 0, off = 0; i < nrInts; i++, off += Integer.BYTES) {
        values[i] = unpackInt(buf, off);
    }
    return values;
}

