public static int hash32(final long data, final int seed) {
    int hash = seed;
    final long r0 = Long.reverseBytes(data);
    hash = mix32((int) r0, hash);
    hash = mix32((int) (r0 >>> 32), hash);
    hash ^= Long.BYTES;
    return fmix32(hash);
}

