private int handleD(final String value, final DoubleMetaphoneResult result, int index) {
    if (contains(value, index, 2, "DG")) {
        //-- "Edge" --//
        if (contains(value, index + 2, 1, "I", "E", "Y")) {
            result.append('J');
            index += 3;
            //-- "Edgar" --//
        } else {
            result.append("TK");
            index += 2;
        }
    } else if (contains(value, index, 2, "DT", "DD")) {
        result.append('T');
        index += 2;
    } else {
        result.append('T');
        index++;
    }
    return index;
}

