        throw new IllegalArgumentException("ruleType must not be " + RuleType.RULES);
    }
    this.nameType = nameType;
    this.ruleType = ruleType;
    this.concat = concatenate;
    this.lang = Lang.instance(nameType);
    this.maxPhonemes = maxPhonemes;
}

