private static boolean startsWith(final CharSequence input, final CharSequence prefix) {
    if (prefix.length() > input.length()) {
        return false;
    }
    for (int i = 0; i < prefix.length(); i++) {
        if (input.charAt(i) != prefix.charAt(i)) {
            return false;
        }
    }
    return true;
}

