private static String stripQuotes(String str) {
    if (str.startsWith(DOUBLE_QUOTE)) {
        str = str.substring(1);
    }
    if (str.endsWith(DOUBLE_QUOTE)) {
        str = str.substring(0, str.length() - 1);
    }
    return str;
}

