int getMinRating(final int sumLength) {
    int minRating = 0;
    if (sumLength <= 4) {
        minRating = 5;
    } else if (sumLength <= 7) {
        // already know it is at least 5
        minRating = 4;
    } else if (sumLength <= 11) {
        // already know it is at least 8
        minRating = 3;
    } else if (sumLength == 12) {
        minRating = 2;
    } else {
        // docs said little here.
        minRating = 1;
    }
    return minRating;
}

