    } else if (object instanceof ByteBuffer) {
        byteArray = toByteArray((ByteBuffer) object);
    } else {
        try {
            byteArray = (byte[]) object;
        } catch (final ClassCastException e) {
            throw new EncoderException(e.getMessage(), e);
        }
    }
    return encodeHex(byteArray);
}

